import React from "react";
import mchammer from "../../img/test/mchammer.gif";
import divider from "../../img/test/divider4.gif";
import selfIcon from "../../img/self_image.png";
import "./Main.css";

const Icon = () => {
  return <img src={selfIcon} alt="icon of myself"></img>;
};

const McHammer = () => {
  return <img src={mchammer} alt="gif of mchammer" className="hammer"></img>;
};

const Divider = () => {
  return <img src={divider}></img>;
};

const Main = () => {
  return (
    <div>
      <div className="welcome">
        <h1 style={{ marginTop: "50px" }} className="welcome-msg">
          Welcome to the 20000 legues under the sea!!!<br></br>I think you are
          at a right place darling
        </h1>
        <McHammer />
        <McHammer />
        <McHammer />
        <McHammer />
      </div>
      <div className="divider">
        <Divider />
        <Divider />
      </div>
    </div>
  );
};

export default Main;
